INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 7001, 7, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106001, "キャル", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 7002, 7, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105901, "コッコロ", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 7003, 7, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105801, "ペコリーヌ", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 10001, 10, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105801, "ペコリーヌ", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 10002, 10, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106001, "キャル", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 10003, 10, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105901, "コッコロ", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 10004, 10, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106401, "シェフィ", 0.0, 2, 1, 0, 2104010);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 12001, 12, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", -416.5, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105801, "ペコリーヌ", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 13001, 13, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106001, "キャル", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 13002, 13, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105901, "コッコロ", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 13003, 13, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106401, "シェフィ", 0.0, 2, 1, 0, 2104010);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 13004, 13, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105801, "ペコリーヌ", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 14001, 14, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105901, "コッコロ", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 14002, 14, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106401, "シェフィ", 0.0, 2, 1, 0, 2104010);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 14003, 14, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105801, "ペコリーヌ", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 14004, 14, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106001, "キャル", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 15001, 15, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", -470.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105901, "コッコロ", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 16001, 16, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106401, "シェフィ", 0.0, 2, 1, 0, 2104010);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 16002, 16, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105801, "ペコリーヌ", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 16003, 16, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106001, "キャル", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 16004, 16, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105901, "コッコロ", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 17002, 17, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105901, "コッコロ", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 17004, 25, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106001, "キャル", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 17005, 25, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105901, "コッコロ", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 17006, 25, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106401, "シェフィ", 0.0, 2, 1, 0, 2104010);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 17007, 25, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105801, "ペコリーヌ", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 18001, 18, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 190801, "カリン", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (2, 18002, 18, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 190801, "カリン", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (3, 19001, 19, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", -470.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 190801, "カリン", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (4, 19002, 19, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", -470.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 190801, "カリン", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (5, 20001, 20, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", -470.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 190801, "カリン", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (6, 20002, 20, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", -470.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 190801, "カリン", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 21001, 21, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106001, "キャル", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 21002, 21, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105901, "コッコロ", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 21003, 21, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106401, "シェフィ", 0.0, 2, 1, 0, 2104010);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 21004, 21, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105801, "ペコリーヌ", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 22001, 22, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", -430.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 190801, "カリン", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (2, 22002, 22, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", -430.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 190801, "カリン", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (3, 23001, 23, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", -430.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 190801, "カリン", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (4, 23002, 23, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", -430.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 190801, "カリン", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 24001, 24, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", -385.0, 4.08, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109001, "エリコ（バレンタイン）", 8.0, 1, 2, 10011, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (2, 24002, 24, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", -385.0, 5.0, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109001, "エリコ（バレンタイン）", 8.0, 1, 2, 10011, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (3, 24003, 24, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", -385.0, 10.11, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109001, "エリコ（バレンタイン）", 8.0, 1, 2, 10011, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (4, 24004, 24, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", -385.0, 4.0, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109001, "エリコ（バレンタイン）", 8.0, 1, 2, 10011, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (5, 24005, 24, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", -385.0, 6.0, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109001, "エリコ（バレンタイン）", 8.0, 1, 2, 10011, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (6, 24006, 24, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 0.0, 0.0, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109002, "エリコ（バレンタイン）", 0.0, 1, 1, 10011, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (7, 24007, 24, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 0.0, 0.0, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109002, "エリコ（バレンタイン）", 0.0, 1, 1, 10011, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (8, 24008, 24, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 0.0, 0.0, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109002, "エリコ（バレンタイン）", 0.0, 1, 1, 10011, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (9, 24009, 24, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 0.0, 0.0, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109002, "エリコ（バレンタイン）", 0.0, 1, 1, 10011, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (10, 24010, 24, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 0.0, 0.0, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109002, "エリコ（バレンタイン）", 0.0, 1, 1, 10011, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 24011, 24, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", -385.0, 2.12, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109101, "シズル（バレンタイン）", 8.0, 1, 2, 10011, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (2, 24012, 24, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", -385.0, 4.19, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109101, "シズル（バレンタイン）", 8.0, 5, 2, 10011, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (3, 24013, 24, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", -385.0, 2.3, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109101, "シズル（バレンタイン）", 8.0, 2, 4, 10011, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (4, 24014, 24, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 0.0, 0.0, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109102, "シズル（バレンタイン）", 0.0, 1, 1, 10011, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (5, 24015, 24, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", -385.0, 5.23, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109101, "シズル（バレンタイン）", 8.0, 5, 2, 10011, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (6, 24016, 24, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 0.0, 0.0, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109102, "シズル（バレンタイン）", 0.0, 1, 1, 10011, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (7, 24017, 24, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", -385.0, 5.01, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109101, "シズル（バレンタイン）", 8.0, 1, 2, 10011, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (8, 24018, 24, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 0.0, 0.0, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109102, "シズル（バレンタイン）", 0.0, 1, 1, 10011, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (9, 24019, 24, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 0.0, 0.0, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109102, "シズル（バレンタイン）", 0.0, 1, 1, 10011, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (10, 24020, 24, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 0.0, 0.0, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109102, "シズル（バレンタイン）", 0.0, 1, 1, 10011, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 26001, 26, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106401, "シェフィ", 0.0, 2, 1, 0, 2104010);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 26002, 26, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105801, "ペコリーヌ", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 26003, 26, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106001, "キャル", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 26004, 26, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105901, "コッコロ", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 27001, 27, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106401, "シェフィ", 0.0, 2, 1, 0, 2104010);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 27002, 27, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105801, "ペコリーヌ", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 27003, 27, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106001, "キャル", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 27004, 27, "こちらにさらなる力を得る\nためのアイテムが眠っている\nようです。主さま、どこから\n挑戦いたしましょう。", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105901, "コッコロ", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 28001, 28, "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！", -363.0, 0.0, "2030/12/17 14:59:59", "2019/09/24 15:00:00", 190801, "カリン", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (2, 28002, 28, "ギルド管理協会です\nフレンドに関しては\nこちらでご確認ください", -363.0, 0.0, "2030/12/17 14:59:59", "2019/09/24 15:00:00", 190801, "カリン", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (3, 29001, 29, "こちらがフレンドの\n皆さんです\n素敵な関係を\n築いてくださいね！", -409.0, 0.0, "2030/12/17 14:59:59", "2019/09/24 15:00:00", 190801, "カリン", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (4, 29002, 29, "こちらの一覧で\nフレンドのプロフィールを\n確認できますよ", -409.0, 0.0, "2030/12/17 14:59:59", "2019/09/24 15:00:00", 190801, "カリン", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (5, 30001, 30, "フレンド管理は\nこちらになります\n新しいフレンドとの出会いを\n楽しんでくださいね！", -409.0, 0.0, "2030/12/17 14:59:59", "2019/09/24 15:00:00", 190801, "カリン", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (6, 30002, 30, "フレンドの申請や\n承認ができますよ\nどうぞ、良き交流を！", -409.0, 0.0, "2030/12/17 14:59:59", "2019/09/24 15:00:00", 190801, "カリン", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (7, 31001, 31, "バトルをして力比べを\nしてみましょう！\n実力が試されますね、\n頑張ってください！", -409.0, 0.0, "2030/12/17 14:59:59", "2019/10/31 12:00:00", 190801, "カリン", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (8, 31002, 31, "気になるパーティと\nバトルをしてみましょう！\nどちらが勝利するのか、\n私も楽しみにしていますね", -409.0, 0.0, "2030/12/17 14:59:59", "2019/10/31 12:00:00", 190801, "カリン", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 32001, 32, "ルーキーの皆さんのために\n特別なミッションを\nご用意いたしました！\nぜひ、挑戦してください！", -409.0, 0.0, "2020/01/04 4:59:59", "2019/12/20 5:00:00", 190801, "カリン", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (2, 32002, 32, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", -409.0, 0.0, "2020/01/04 4:59:59", "2019/12/20 5:00:00", 190801, "カリン", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (3, 33001, 33, "フレンドになって\n初心者の方を応援しましょう！\n素敵な報酬が待っていますよ！", -409.0, 0.0, "2020/01/04 4:59:59", "2019/12/20 5:00:00", 190801, "カリン", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (4, 33002, 33, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", -409.0, 0.0, "2020/01/04 4:59:59", "2019/12/20 5:00:00", 190801, "カリン", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (5, 34001, 34, "お疲れ様でした！\nミッションの報酬の受け取りは\nこちらからできますよ！", -409.0, 0.0, "2020/01/10 11:59:59", "2020/01/04 5:00:00", 190801, "カリン", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (6, 34002, 34, "ミッション報酬の受け取りは\nこちら！\n受け取り漏れの無いように\n気を付けてくださいね！", -409.0, 0.0, "2020/01/10 11:59:59", "2020/01/04 5:00:00", 190801, "カリン", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 38001, 38, "過去のストーリーイベントを\n楽しめちゃいますよ！\n遊んだことのないものがあれば\n一緒にやってみましょう♪", -458.0, 5.3, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105801, "ペコリーヌ", 0.0, 1, 2, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (2, 38002, 38, "これまでのイベントで登場した\n限定キャラを仲間にできたり\nメモリーピースが手に入る\nみたいですよ。やばいですね☆", -458.0, 6.5, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105801, "ペコリーヌ", 0.0, 1, 2, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 39005, 39, "", 9999.0, 0.0, "2020/04/08 23:59:59", "2020/04/01", 105801, "ペコリーヌ", 9999.0, 3, 3, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (2, 40001, 40, "これまでに出題された\n問題を振り返ることが\nできますよ\n復習は大切です♪", -430.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 190801, "カリン", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 41001, 41, "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106401, "シェフィ", 0.0, 1, 1, 0, 2104010);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 41002, 41, "ここで腕試しを\nしていきましょう！\n全力全開、\nがんばっちゃいますよ～！", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105801, "ペコリーヌ", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 41003, 41, "ここで腕試しが\nできるみたいね。\n試してみるのも\nいいんじゃない？", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106001, "キャル", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 41004, 41, "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105901, "コッコロ", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 42001, 42, "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。", -416.5, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105901, "コッコロ", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 42002, 42, "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。", -416.5, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106401, "シェフィ", 0.0, 1, 1, 0, 2104010);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 42003, 42, "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆", -416.5, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105801, "ペコリーヌ", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 42004, 42, "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！", -416.5, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106001, "キャル", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 43001, 43, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105801, "ペコリーヌ", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 43002, 43, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105901, "コッコロ", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 43003, 43, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", -363.0, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106001, "キャル", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 43004, 44, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", -416.5, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 123001, "アメス", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (2, 43005, 44, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", -416.5, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 123001, "アメス", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (3, 43006, 45, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", -416.5, 5.79, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 123001, "アメス", 0.0, 1, 2, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 46001, 46, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", -371.5, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 123001, "アメス", 0.0, 1, 1, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 47001, 47, "呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪", -416.5, 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 104901, "シズル", 0.0, 2, 2, 0, 0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (1, 47002, 47, "ほんとーに不思議な場所ですね～\nお兄ちゃんが冒険を頑張れるよう\nおまじないをかけてあげますねっ\nフレーフレー、お・兄・ちゃんっ♪", -416.5, 9.32, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 101101, "リノ", 0.0, 1, 2, 0, 0);
